      <div className="col-6">
        <div className="text-primary">
          {quoteResponse && symbol.replace(".BK", "")}
        </div>
        <div>{quoteResponse && longName}</div>
      </div>
      <div className="col-2"></div>
      <div className="col-2">
        <div>{marketCap}</div>
        <div>มูลค่าตลาด</div>
      </div>
      <div className="col-2"></div>
    </div>
  );
};

export default Overview;
